import sysfrom elf.headers.ElfHeader import ElfHeaderfrom elf.headers.PhController import PhControllerfrom elf.headers.ShController import ShControllerclass ReadElf:    def __init__(self, filename):        f = open(filename)        self.binList = map(lambda x: int(ord(x)), f.read())        self.eh = ElfHeader(self.binList)        self.eh.retrieve()        self.shCtrl = ShController(self.binList, self.eh)        self.phCtrl = PhController(self.binList, self.eh)        self.phCtrl.setShNames(self.shCtrl.getShList())    def getEh(self):        return self.eh    def getPhCtrl(self):        return self.phCtrl    def getShCtrl(self):        return self.shCtrl